Cancel on
Stop the execution of a running function when a specific event is received using
```
cancelOn
```
.
Copy Copied
```
inngest .createFunction (
{
id : "sync-contacts" ,
cancelOn : [
{
event : "app/user.deleted" ,
// ensure the async (future) event's userId matches the trigger userId
if : "async.data.userId == event.data.userId" ,
} ,
] ,
}
// ...
);
```
Using
```
cancelOn
```
is very useful for handling scenarios where a long-running function should be terminated early due to changes elsewhere in your system.
The API for this is similar to the
[```
step.waitForEvent()
```](\docs\guides\multi-step-functions#wait-for-event)
tool, allowing you to specify the incoming event and different methods for matching pieces of data within.

Cancel on
Examples
With a timeout window
Cancel a function's execution if a matching event is received within a given amount of time from the function being triggered.
v3 v2
Copy Copied
```
inngest .createFunction (
{
id : "sync-contacts" ,
cancelOn : [{ event : "app/user.deleted" , match : "data.userId" , timeout : "1h" }] ,
}
// ...
);
```
This is useful when you want to limit the time window for cancellation, ensuring that the function will continue to execute if no matching event is received within the specified time frame.
